import React, { Component } from 'react';
export default class Weather extends Component {
    constructor(){
        super()

        this.state = {}
    }

    componentDidMount() {
        axios.get('https://dog.ceo/api/breeds/image/random')
        .then(response => {
          console.log(response.data);
        })
        .catch(error => {
          console.log(error);
        });
        this.setState({ statement: 'testing' });
    }

    render() {
      let resumeData = this.props.resumeData;
      return (
        <section id="weather">
            <p>Debug {this.state.statement}</p>
           <div className="row">

              <div className="three columns">

                 <img className="profile-pic"  src="images/weather-icon.jpg" alt="" />

              </div>

              <div className="nine columns main-col">

                 <h2>What's the weather in Singapore?</h2>

                 <p>Debug {this.state.statement}</p>


                 <div className="row">

                    <div className="columns contact-details">

                    <h2>Contact Details</h2>
                    <p className="address">
                                 <span>{resumeData.name}</span>
                       <br></br>
                                    <span>
                       {resumeData.address}
                      </span>
                      <br></br>
                      <span>{resumeData.website}</span>
                                </p>
                    </div>
                 </div>
              </div>
           </div>
        </section>
      );
    }
  }
